// src/components/Dashboard.jsx
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function Dashboard() {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  // Toggle demoMode: when true, Dashboard will auto-navigate: Dashboard -> Register -> Login -> Forgot
  const demoMode = true; // set to false to disable auto-redirect

  useEffect(() => {
    async function fetchMe() {
      // Try to load user (optional)
      const token = localStorage.getItem('token');
      if (!token) {
        setLoading(false);
        // If you don't want to require auth for dashboard demo, comment out the return
        // return navigate('/register');
      } else {
        try {
          const api = process.env.REACT_APP_API_URL || 'http://localhost:10000';
          const res = await fetch(`${api}/api/auth/me`, {
            headers: { Authorization: `Bearer ${token}` }
          });
          if (res.ok) {
            const data = await res.json();
            setUser(data.user);
          } else {
            localStorage.removeItem('token');
          }
        } catch (err) {
          console.error(err);
          localStorage.removeItem('token');
        }
      }
      setLoading(false);
    }

    fetchMe();
  }, []);

  useEffect(() => {
    if (!demoMode) return;
    // Demo redirect sequence with delays (ms)
    const delays = [1500, 1500, 1500]; // dashboard pause, then to register, pause, login, pause, forgot
    let t1, t2, t3, t4;

    // Start after a short pause so the reviewer sees Dashboard first
    t1 = setTimeout(() => {
      // go to Register
      navigate('/register');
      t2 = setTimeout(() => {
        // go to Login
        navigate('/login');
        t3 = setTimeout(() => {
          // go to Forgot (root - which is Dashboard by default in your routes; if you prefer explicit forgot route use /forgot)
          navigate('/forgot' /* or use '/' if you want to return to dashboard */);
        }, delays[2]);
      }, delays[1]);
    }, delays[0]);

    return () => {
      clearTimeout(t1);
      clearTimeout(t2);
      clearTimeout(t3);
      clearTimeout(t4);
    };
  }, [demoMode, navigate]);

  function logout() {
    localStorage.removeItem('token');
    navigate('/login');
  }

  if (loading) {
    return (
      <div className="form-card mx-auto" style={{ maxWidth: 560 }}>
        <div className="card-header">
          <div className="icon"><i className="bi bi-person-circle"></i></div>
          <div className="form-title">Loading Dashboard…</div>
        </div>
        <p style={{ textAlign: 'center', color: '#6b7280' }}>Fetching your account details…</p>
      </div>
    );
  }

  return (
    <div className="form-card mx-auto" style={{ maxWidth: 560 }}>
      <div className="card-header">
        <div className="icon"><i className="bi bi-person-check-fill"></i></div>
        <div className="form-title">Dashboard</div>
        <div className="form-sub">This is your secure dashboard demo.</div>
      </div>

      <div style={{ marginTop: 12 }}>
        <p><strong>Email :</strong> {user ? user.email : 'guest@example.com'}</p>
        <p><strong>Demo tour :</strong> This page will automatically show Register → Login → Forgot (demo mode).</p>

        <div style={{ marginTop: 20, display: 'flex', gap: 12 }}>
          <button className="btn btn-primary" onClick={() => navigate('/register')}>Go to Register</button>
          <button className="btn btn-outline" onClick={() => navigate('/login')} style={{ background: "#fff", border: "1px solid #e5e7eb" }}>Go to Login</button>
          <button className="btn btn-outline" onClick={logout} style={{ background: "#fff", border: "1px solid #e5e7eb" }}>Logout</button>
        </div>
      </div>
    </div>
  );
}
